contracts/newContract.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.8.0;
contract Property {
    
    int public price = 100;
    string constant public location = "London";

    // a setter function cost gas because it alters the blockchain
    function setPrice(int _price) public{
        price = _price;
    }

    // a getter function does not use gas
    function getPrice() public view returns(int) {
        return price;
    }

    function setLocation(string memory location) public{
        
    }

}

